Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
gotoAndPlay(_parent.近战招式);

function 射击()
{
	var 子弹属性 = _root.子弹属性初始化(this.攻击点);
	子弹属性.声音 = "ak47-1.wav";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 4;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "加强普通子弹";
	子弹属性.子弹威力 = _parent.空手攻击力 + 40;
	子弹属性.子弹速度 = 25;
	子弹属性.击中地图效果 = "火花";
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 5;
	子弹属性.击中后子弹的效果 = "";
	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent(load){
   声音 = "ak47-1.wav";
   霰弹值 = 1;
   子弹散射度 = 4;
   发射效果 = "";
   子弹种类 = "加强普通子弹";
   子弹威力 = 40;
   子弹速度 = 25;
   击中地图效果 = "火花";
   Z轴攻击范围 = 30;
   击倒率 = 5;
   击中后子弹的效果 = "";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

